INSERT INTO `ecommerceapp_items` VALUES (1,'SAMSUNG 80 cm (32 Inch) HD Ready LED Smart Tizen TV with Bezel-free Design  (UA32T4380AKXXL)','RetailNet','media/items/samsung_32_inch_HD.webp',132,18900.00,15499.00,'With this Samsung TV, every image on the screen comes to life, giving you a home theatre experience. With the HD visual quality of this TV, you can enjoy vibrant movie scenes. Additionally, HDR increases the screen\'s brightness and brings out the subtleties of the material. Moreover, the Contrast Enhancer on this TV improves contrast and offers superb image quality with increased depth.',1,'2024-04-19 06:55:44.575682',1,10,'Supported Apps: Netflix|Prime Video|Disney+Hotstar|Youtube','Operating System: Tizen','Resolution: Full HD 1920 x 1080 Pixels','Sound Output: 20 W','Refresh Rate: 60 Hz'),(3,'SAMSUNG Crystal 4K Vivid 108 cm (43 inch) Ultra HD (4K) LED Smart Tizen TV 2024 Edition  (UA43DUE70BKLXL)','IWQNBecommerce','static/media/items/-original-imagzu9umhegyggm.webp',89,44599.00,38999.00,'The Samsung Crystal UHD Smart TV has an array of features for an exceptional theatre-like experience in the comfort of your home. You can see your favourite stars come to life on this TV, thanks to the PurColour featured in it. With a 4K upscaling feature, this TV allows you to watch all your favourite content in 4K resolution by upscaling lower-quality content',1,'2024-04-19 07:34:13.952215',0,10,'Supported Apps: Netflix|Prime Video|Disney+Hotstar|Youtube','Operating System: Tizen','Resolution: HD Ready 1366 x 768 Pixels','Sound Output: 20 W','Refresh Rate: 50 Hz'),(4,'SAMSUNG 108 cm (43 inch) Full HD LED Smart Tizen TV 2023 Edition  (UA43T5450AKXXL)','RetailNet','static/media/items/samsung_108CM.webp',155,37999.00,28499.00,'Discover a new era of TV entertainment that combines stunning visuals, immersive audio, and seamless connectivity. This TV is more than just a screen – it\'s a gateway to a world of captivating experiences. Step into the future of entertainment, wher