he PurColor, Motion Xcelerator, and Crystal Processor 4K technologies; and to watch content from your smartphone and other devices, it has Tap View and PC on TV features.',1,'2024-04-19 08:14:29.898326',0,10,'Supported Apps: Netflix|Disney+Hotstar|Youtube','Operating System: Tizen','Resolution: Ultra HD (4K) 3840 x 2160 Pixels','Sound Output: 20 W','Refresh Rate: 60 Hz'),(15,'SAMSUNG Crystal 4K Neo Series 108 cm (43 inch) Ultra HD (4K) LED Smart Tizen TV with Voice Search  (UA43AUE65AKXXL)','RetailNet','static/media/items/-original-imaguy5ffnchjcyh.webp',68,47600.00,31500.00,'Experience watching all your favourite content in 4K quality by bringing home the Samsung UHD (4K) Neo Smart TV. Powered by Crystal Technology, the television boasts some best-in-segment features such as One Billion True Colours for authentic representation of every colour, HDR10+ for crisp visuals even during dark scenes and a Bezel-less Design for an immersive viewing experience.',1,'2024-04-19 08:15:42.130579',0,10,'Supported Apps: Netflix|Prime Video|Disney+Hotstar|Youtube','Operating System: Tizen','Resolution: Ultra HD (4K) 3840 x 2160 Pixels','Sound Output: 20 W','Refresh Rate: 50 Hz'),(16,'SAMSUNG The Frame 138 cm (55 inch) QLED Ultra HD (4K) Smart Tizen TV with Matte Display  (QA55LS03BAKLXL)','RetailNet','static/media/items/-original-imaggwfzpgv9pbht.webp',58,144500.00,87600.00,'Get immersed and lose yourself in the world of true visual amusement with the unique Samsung TV that comes loaded with mesmerising features to blow your mind with its incredible performance. This TV boasts a matte display that enhances every content played on the TV, offering a brilliant viewing experience. Furthermore, with its modern design and terrific appearance, this TV gets all the attention and more when placed in the living room',1,'2024-04-19 08:17:01.823749',0,10,'Supported Apps: Netflix|Prime Video|Disney+Hotstar|Youtube','Operating System: Tizen','Resolution: Ultra HD (4K) 3840 x 2160 Pixels','Soun