moment throughout your TV-viewing experience. Moreover, with the Screen Mirroring feature, you can connect your compatible devices and watch your favourite TV shows on the big screen.',1,'2024-04-19 08:19:57.204707',0,10,'Supported Apps: Netflix|Prime Video|Disney+Hotstar|Youtube','Operating System: Tizen','Resolution: Ultra HD (4K) 3840 x 2160 Pixels','Sound Output: 20 W','Refresh Rate: 60 Hz'),(20,'SAMSUNG Q60BAKL 138 cm (55 inch) QLED Ultra HD (4K) Smart Tizen TV  (QA55Q60BAKLXL)','SameDayDeliveryBLR','static/media/items/qa55q60baklxl-samsung-original-imagg9pytvcaheh3.webp',88,121600.00,63990.00,'Indulge into a smart and user-friendly TV watching experience as you bring home the Samsung Smart QLED TV. Driven by Samsung’s Quantum Dot technology and the Quantum HDR technology, this TV offers realistic visuals with incredible color reproduction. Also, it comes with a Q- Symphony technology so that you can enjoy using both the soundbar and the TV speakers at the same tim',1,'2024-04-19 08:21:02.098724',0,10,'Supported Apps: Netflix|Prime Video|Disney+Hotstar|Youtube','Operating System: Tizen','Resolution: Ultra HD (4K) 3840 x 2160 Pixels','Sound Output: 20 W','Refresh Rate: 50 Hz'),(21,'SAMSUNG 138 cm (55 inch) Ultra HD (4K) LED Smart Tizen TV  (UA55BU8000KLXL)','SameDayDeliveryBLR','static/media/items/ua55bu8000klxl-samsung-original-imaggb4zpx37wgee.webp',84,86400.00,65499.00,'Indulge yourself in a world of infinite visual entertainment with the one-of-a-kind Samsung TV, which is packed with captivating features and will take your breath away with its remarkable performance. This TV offers a brilliant colour-enriched picture that brings out the best in every piece of material it displays, providing a fantastic viewing experience',1,'2024-04-19 08:22:00.799676',0,10,'Supported Apps: Netflix|Prime Video|Disney+Hotstar|Youtube','Operating System: Tizen','Resolution: Ultra HD (4K) 3840 x 2160 Pixels','Sound Output: 20 W','Refresh Rate: 50 Hz'),(22,'SAMSUNG The Frame 202